CREATE TABLE Locations (
    location_id INT PRIMARY KEY,
    location_name VARCHAR(255),
    latitude DECIMAL(10,6),
    longitude DECIMAL(10,6)
);

CREATE TABLE solar_panels (
	panel_id INT PRIMARY KEY,
	efficiency_rating FLOAT,
	manufacturer VARCHAR(50),
	production_date DATE
);

CREATE TABLE SolarPanels (
    panel_id INT PRIMARY KEY,
    manufacturer VARCHAR(50),
    efficiency_rating DECIMAL(5,2),
    production_date DATE
);

CREATE TABLE solar_panels (
    id INT PRIMARY KEY,
    panel_name TEXT,
    efficiency_rating FLOAT
);

CREATE TABLE panel_manufacturers (
    id INT PRIMARY KEY,
    manufacturer_name TEXT,
    country TEXT
);

CREATE TABLE panel_locations (
    id INT PRIMARY KEY,
    location_name TEXT,
    address TEXT,
    city TEXT
);

CREATE TABLE panel_installations (
    id INT PRIMARY KEY,
    installation_date DATE,
    panel_id INT REFERENCES solar_panels(id),
    location_id INT REFERENCES panel_locations(id)
);

CREATE TABLE panel_ratings (
    id INT PRIMARY KEY,
    rating_date DATE,
    efficiency_rating FLOAT,
    panel_id INT REFERENCES solar_panels(id)
);
